import logo from './logo.svg';
import './App.css';
import React from 'react';


function Tile(props) {
    return (
      <button className="tile">
      </button>
    );
}

class Board extends React.Component {
  constructor(props) {
    super(props);
  }
  renderTile() {
    return (
      <Tile 
      />
    );

  }
  render() {
    const board=[];
    for(let row=0;row<3;row++) {
      const boardRow=[];
      for(let col=0;col<3;col++) {
        boardRow.push(this.renderTile());
      }
      board.push(<div className="board-row">{boardRow}</div>)
    }
    return (
      <div>
        {board}
      </div>
    );

  }
}

class Game extends React.Component {
  render() {
    return (
      <div className="game">
        <div className="game-info">
        </div>
        <div className="game-board">
          <Board />
        </div>

      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <div className="Game">
        <Game />
      </div>
    </div>
  );
}



export default App;
